import sys
from Crypto.SelfTest.st_common import a2b_hex
import hashlib
from Crypto.Cipher import AES
import base64
from common.configLog import logger


def md5Encode(str):
    m = hashlib.md5()
    m.update(str.encode("utf-8"))
    return m.hexdigest().upper()


def sha256Encode(str):
    m = hashlib.sha256()
    m.update(str.encode("utf-8"))
    return m.hexdigest()


def aes_encrypt(key, text):
    """
    :param key:
    :param text:
    :return:
    """
    try:
        # key = bytes(key, encoding="utf8")
        BS = len(key)
        pad = lambda s: s + (BS - len(s) % BS) * chr(BS - len(s) % BS)
        # unpad = lambda s: s[0:-ord(s[-1])]
        key_bytes = str.encode(key)
        cryptor = AES.new(key=key_bytes, mode=AES.MODE_ECB)
        # 这里密钥key 长度必须为16（AES-128）、24（AES-192）、或32（AES-256）Bytes 长度.目前AES-128足够用
        # padding = lambda s: s + (16 - len(s) % 16) * chr(16 - len(s) % 16)
        encrypt_str = cryptor.encrypt(pad(text).encode('UTF-8'))
        result_str = base64.urlsafe_b64encode(encrypt_str)
    except Exception as msg:
        logger.error("aes_encrypt" + msg)
    return result_str


def aes_decrypt(key, iv, text):
    """
    aes解密
    :param text: 解密文本
    :return:
    """
    try:
        mode = AES.MODE_CBC
        b_key = key.encode('utf-8')
        # b_iv = bytes(iv, encoding="utf8")
        b_iv = iv.encode('utf-8')
        cryptos = AES.new(b_key, mode, b_iv)
        plain_text = cryptos.decrypt(a2b_hex(text))
        return bytes.decode(plain_text).rstrip('\0')
    except Exception as msg:
        raise Exception(logger.error("aes_encrypt" + msg))


def get_sign(data, accessToken):
    datas = sorted(data.items(), key=lambda x: x[0])
    encrypt_data = "&".join([i + "=" + str(j) for i, j in datas]) + "&" + accessToken
    sign = md5Encode(encrypt_data)
    return sign


def get_sign_sha256(data, accessToken):
    datas = sorted(data.items(), key=lambda x: x[0])
    encrypt_data = "&".join([i + "=" + str(j) for i, j in datas]) + "&" + accessToken
    sign = sha256Encode(encrypt_data)
    return sign


def get_key(data, appSecret):
    datas = sorted(data.items(), key=lambda x: x[0])
    encrypt_data = "&".join([i + "=" + str(j) for i, j in datas if j and i != 'appId' and not isinstance(j, list) and not isinstance(j, dict)]) + "&" + appSecret
    key = md5Encode(encrypt_data)
    return key.upper()


